const e={a1:"List controls display information and actions for list items.",a2:"List controls provide information, indicate a state, or present actions for list items. List controls appear as icons to the left or right of list text.",a3:"List control placement:",a4:"States and primary actions are placed on the left side of a list tile.",a5:"Secondary actions and info are placed on the right side of the tile.",a6:"Types",a7:"Checkbox<br />Switch<br />Reorder<br />Expand/collapse<br />Leave-behinds",a8:"Menu controls",a9:"Check<br />Inline information<br />Nested menu indicator",a10:"Usage",a11:"Types of list controls",a12:"Types of menu controls",a13:"List controls fall under four categories:",a14:"State",a15:"Primary action (including text strings)",a16:"Secondary action",a17:"Secondary info",a18:"Distinguishing elements of list tiles need to be on the left for left-to-right interfaces, and vice versa. States and primary actions are placed on the left side of a list tile. Text within a list item should be considered part of the primary action target.",a19:"Don’t place two icons or actions next to one another, such as a checkbox next to an avatar.",a20:"If the primary action of the list item is navigational, don’t use an icon. The list item itself and its context should be sufficient to communicate the destination.",a21:"Secondary actions and info should be placed on the right side of the title. Secondary actions are always a separate target from the primary action, as users increasingly expect every icon to trigger an action.",a22:"States and primary actions are placed on the left side of a list tile. The secondary action and secondary info should be placed on the right side of the title.",a23:"Checkbox",a24:"A checkbox can either be a primary action or a secondary action.",a25:"Type: primary action/state",a26:"Desktop checkboxes should appear only on hover and focus.",a27:"The checkbox is the primary action and the state indicator for the list item.",a28:"Type: secondary action",a29:"Separate target",a30:"When controlling a family of variables, consider using switches instead.",a31:"The checkbox is the secondary action for the list item.",a32:"Switch",a33:"Type: secondary action",a34:"Separate target",a35:"The switch is the secondary action and a separate target.",a36:"Reorder",a37:"Type: secondary action",a38:"Usually a separate target, depending on which mode list it is in.",a39:"Allows dragging of the list item to other locations within the list. It usually appears in list editing mode.",a40:"The reorder icon is the secondary action for the list item.",a41:"Expand/collapse",a42:"Type: secondary action",a43:"Separate target",a44:"Expands and collapses a list view vertically to show and hide details of existing list items.",a45:"By touching the list control, the user expands the list.",a46:"The list is expanded.",a47:"Collapsed single-line item",a48:"Expanded single-line item",a49:"Leave-behinds",a50:"Type: Other",a51:"A leave-behind is an informative hint as to what swiping a list item away will do to that item. The leave-behind can transform into an action.",a52:"Swiping on a list item from either direction will reveal an icon indicating the action. After swiping, a follow-up action can appear as a text button within the space of the list item.",a53:"Swiping on a list item from right to left will reveal an icon indicating the action.",a54:"Swiping on a list item from left to right will reveal an icon indicating the action.",a55:"A menu is a special type of list. In menus, use controls that are appropriate for dropdown menus, overflow menus, and so on. Don’t use these controls in regular lists. Use the regular list controls instead.",a56:"Check",a57:"Type: state",a58:"Not a separate target.",a59:"Menus only. Indicates that the list item has been selected. The selection is done through a different control.",a60:"The check indicates that the list item has been selected.",a61:"Inline information",a62:"Type: secondary info",a63:"Not a separate target.",a64:"Menus only. Inline information is a small snippet of text related to the line title that can provide information or a tip, like a keyboard shortcut. It cannot be truncated.",a65:"The inline information for Bold, Italic and Underline provide keyboard shortcuts.",a66:"Nested menu indicator",a67:"Type: primary action",a68:"Not a separate target.",a69:"Menus only. The glyph indicates that a secondary menu will fly out upon hover, focus, and/or selection.",a70:"The glyphs for the menu items indicate that a secondary menu will fly out upon hover, focus, and/or selection.",a71:"Material Design: List controls for item information and actions",a72:"Material Design list controls: state, actions, and info",a73:"Material Design checkbox as primary action and state indicator",a74:"Checkbox as secondary action in Material Design",a75:"Switch as secondary action in Material Design",a76:"Reorder icon for list item in Material Design",a77:"Expand list control in Material Design by touch",a78:"Expanded list in Material Design",a79:"Collapsed single-line item in Material Design",a80:"Expanded single-line item in Material Design",a81:"Material Design: Swipe left to reveal action icon",a82:"Material Design: Swipe to reveal action icon",a83:"Material Design check indicates selected list item",a84:"Material Design keyboard shortcuts for Bold, Italic, Underline",a85:"Material Design menu items indicate flyout on interaction"};export{e as en};
